import React from "react";

class GameBoard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      step: 1,
      oneOne: "",
      oneTwo: "",
      oneThree: "",

      twoOne: "",
      twoTwo: "",
      twoThree: "",

      threeOne: "",
      threeTwo: "",
      threeThree: "",
    };
  }
  returnInfo = this.props.shiftDate;
  goPlay = {
    step: 1,
    oneOne: "",
    oneTwo: "",
    oneThree: "",

    twoOne: "",
    twoTwo: "",
    twoThree: "",

    threeOne: "",
    threeTwo: "",
    threeThree: "",
  };
  render() {
    return (
      <div className="playPlace">
        <div id="oneOne" onClick={this.logicPro}>
          {this.state.oneOne}
        </div>
        <div id="oneTwo" onClick={this.logicPro}>
          {this.state.oneTwo}
        </div>
        <div id="oneThree" onClick={this.logicPro}>
          {this.state.oneThree}
        </div>

        <div id="twoOne" onClick={this.logicPro}>
          {this.state.twoOne}
        </div>
        <div id="twoTwo" onClick={this.logicPro}>
          {this.state.twoTwo}
        </div>
        <div id="twoThree" onClick={this.logicPro}>
          {this.state.twoThree}
        </div>

        <div id="threeOne" onClick={this.logicPro}>
          {this.state.threeOne}
        </div>
        <div id="threeTwo" onClick={this.logicPro}>
          {this.state.threeTwo}
        </div>
        <div id="threeThree" onClick={this.logicPro}>
          {this.state.threeThree}
        </div>
      </div>
    );
  }
  logicPro = (e) => {
    if (e.target.id === "oneOne" && this.returnInfo.oneOne === "") {
      if (this.state.step % 2 === 0) {
        this.state.oneOne = "0";
        this.state.step += 1;
      } else {
        this.state.oneOne = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "oneTwo" && this.returnInfo.oneTwo === "") {
      if (this.state.step % 2 === 0) {
        this.state.oneTwo = "0";
        this.state.step += 1;
      } else {
        this.state.oneTwo = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "oneThree" && this.returnInfo.oneThree === "") {
      if (this.state.step % 2 === 0) {
        this.state.oneThree = "0";
        this.state.step += 1;
      } else {
        this.state.oneThree = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "twoOne" && this.returnInfo.twoOne === "") {
      if (this.state.step % 2 === 0) {
        this.state.twoOne = "0";
        this.state.step += 1;
      } else {
        this.state.twoOne = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "twoTwo" && this.returnInfo.twoTwo === "") {
      if (this.state.step % 2 === 0) {
        this.state.twoTwo = "0";
        this.state.step += 1;
      } else {
        this.state.twoTwo = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "twoThree" && this.returnInfo.twoThree === "") {
      if (this.state.step % 2 === 0) {
        this.state.twoThree = "0";
        this.state.step += 1;
      } else {
        this.state.twoThree = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "threeOne" && this.returnInfo.threeOne === "") {
      if (this.state.step % 2 === 0) {
        this.state.threeOne = "0";
        this.state.step += 1;
      } else {
        this.state.threeOne = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "threeTwo" && this.returnInfo.threeTwo === "") {
      if (this.state.step % 2 === 0) {
        this.state.threeTwo = "0";
        this.state.step += 1;
      } else {
        this.state.threeTwo = "X";
        this.state.step += 1;
      }
    }
    if (e.target.id === "threeThree" && this.returnInfo.threeThree === "") {
      if (this.state.step % 2 === 0) {
        this.state.threeThree = "0";
        this.state.step += 1;
      } else {
        this.state.threeThree = "X";
        this.state.step += 1;
      }
    }

    this.props.saveInfo(this.goPlay);
  };
}
export default GameBoard;
